	public sealed class ItemDb
	{
		[Serializable]
		private struct ItemDataDeserialize
		{
			public ItemData[] Items;
		}

		[Serializable]
		public struct ItemData
		{
			public ItemSpriteIDs sprId;
			public WeaponShieldAnimatorIDs viewId;
			public Common.ItemType type;
			public Common.EquipmentLocation loc;
		}


		public static readonly ItemData[] Items;

		static ItemDb()
		{

			TextAsset jsonFile = AssetBundleProvider.LoadMiscBundleAsset<TextAsset>("itemDb");
			Items = JsonUtility.FromJson<ItemDataDeserialize>(jsonFile.text).Items;
		}
	}
